import axios from "axios";
import { useStateValue } from "../Stateprovider";

export const execute = async () => {
  const [{ listing_result }, dispatch] = useStateValue();
  axios
    .get("http://localhost:3001/")
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: "UPDATE_LISTING",
        
      });
      return res.data;
    })
    .catch((err) => {
      console.log(err);
    });
};
